import logo from "./aqx_logo.png"
import profile from "./profile_img.png"
import question from "./question_img.png"
import search from "./search_img.png"
const Navbar = () => {
    return (  
        <div className="w-screen h-24 bg-[#0e0833] flex">
            <img  src={logo}></img>
            <div className="w-fit  ">
                <button style={{
                    backgroundImage:{profile}
                }}></button>
            </div>

        </div>
    );
}

export default Navbar;
